import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";

export const Routes = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" render={() => <div>hi</div>} />
      </Switch>
    </BrowserRouter>
  );
};
